export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},CUOfXgpFsc:{data:{id:1671,attributes:{imdbId:"tt0790724",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTM1NjUxMDI3OV5BMl5BanBnXkFtZTcwNjg1ODM3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"},{Source:"Metacritic",Value:"50\u002F100"}],item_lang:{data:{id:2334,attributes:{title:"Jack Reacher",plot:"In an innocent heartland city, five are shot dead by an expert sniper. The police quickly identify and arrest the culprit, and build a slam-dunk case. But instead of confessing, the accused man writes the words, \"Get Jack Reacher.\" Reacher himself sees the news report and turns up in the city. The defense is immensely relieved, but Reacher has come to bury the guy. Shocked at the accused's request, Reacher sets out to confirm for himself the absolute certainty of the man's guilt, but comes up with more than he bargained for.",slug:"jack-reacher"}}},books:{data:[{id:8645,attributes:{title:e,description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B2qS_L7vJy4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:f,publisher:i,subtitle:j}},{id:8646,attributes:{title:e,description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sir9aXL9HCcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2009-01-01",publisher:i,subtitle:k}},{id:8647,attributes:{title:"Jack Reacher : one shot",description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bc5opOzZ4OQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:f,publisher:"Random House",subtitle:k}},{id:8648,attributes:{title:"Jack Reacher: One Shot",description:"NOW A MAJOR MOTION PICTURE • “Pure, escapist gold . . . Mr. Child’s tough talk and thoughtful plotting make an ingenious combination.”—The New York Times Six shots. Five dead. One heartland city thrown into a state of terror. But within hours the cops have it solved: a slam-dunk case. Except for one thing. The accused man says: You got the wrong guy. Then he says: Get Reacher for me. And sure enough, ex—military investigator Jack Reacher is coming. He knows this shooter–a trained military sniper who never should have missed a shot. Reacher is certain something is not right–and soon the slam-dunk case explodes. Now Reacher is teamed with a beautiful young defense lawyer, moving closer to the unseen enemy who is pulling the strings. Reacher knows that no two opponents are created equal. This one has come to the heartland from his own kind of hell. And Reacher knows that the only way to take him down is to match his ruthlessness and cunning–and then beat him shot for shot.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oP9lscxNcZgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2005-06-14",publisher:"Delacorte Press",subtitle:"A Novel"}},{id:8649,attributes:{title:e,description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gqwRMAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:f,publisher:"Random House Large Print Publishing",subtitle:j}}]}}},meta:{}}},prerenderedAt:1682568462446}}("Lee Child","movie","Ex-military investigator Jack Reacher is called in by James Barr, a man accused of a lethal sniper attack that leaves five people dead, and teams up with a young defense attorney to find an unseen enemy who is manipulating events.",null,"One Shot","2012-01-01","series",1,"Dell Publishing Company","A Jack Reacher Novel",""))